    [],nt"revision_timestamp": "2016-10-15T16:35:36.800874",nt"name": "moosehorn-national-wildlife-refuge-may-june-july-august-1943-narrative-report",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Moosehorn NWR
    (including the Edmunds Unit) outlines Refuge accomplishments from May through August
    of 1943. The report begins by summarizing the weather conditions and water conditions
    during this period. Wildlife- including migratory birds, upland game birds, big
    game animals, furbearers, raptors, and fish- is also covered. The Refuge development
    and maintenance section discusses physical developments. Resource management is
    outlined; topics include grazing, haying, and timber removal. A progress report
    on field investigations and applied research is also provided. The public relations
    section of the report describes recreational uses, Refuge visitors, and violations.
    N-R forms are attached.",nt"license_title": "License Not Specified",nt"extras":
